import React,{Component} from 'react';



class Fetchpokemon extends Component {
    constructor (){
    	super();
    	this.state = {
    		pokemonid : []
    	}
    }
    componentDidMount(){
    	console.log(this.props.url)
        this.props.url.forEach((url)=>{
    	fetch(url)
    	.then(resp => resp.json())
    	.then(info=>this.setState({pokemonid:[...this.state.pokemonid,info.id]}))

    })
    }
    render(){
    var display =[];
    this.state.pokemonid.forEach(value=>{
        display.push(<li key = {this.state.pokemonid.indexOf(value)}>{value}</li>)

    })

    return display;
}
}



export default Fetchpokemon;
